import "./register.css"
import { useRef } from "react";

export default function Register() {
  const email = useRef();
  const username = useRef();
  const password0 = useRef();
  const password1 = useRef();

  const handleClick = (e) => {
    e.preventDefault();
    // loginCall({username:username.current.value,password:password.current.value}, dispatch)
  };

  return (
    <div className="register">
      <div className="registerWrapper">
        <div className="registerLeft">
          <h3 className="registerLogo">Planted</h3>
          <span className="registerDesc">Connect with other plant enthusiasts like you!</span>
        </div>
        <div className="registerRight">
          <div className="registerBox">
            <input placeholder="Email" className="registerInput" ref={email} />
            <input placeholder="Username" className="registerInput" ref={username}/>
            <input placeholder="Password" type="password" className="registerInput" ref={password0}/>
            <input placeholder="Re-enter Password" type="password" className="registerInput" ref={password1}/>
            <button className="registerButton">Sign Up</button>
            <span className="registerLogin">Already have an account?</span>
            <button className="registerLoginButton">Log In</button>
          </div>
        </div>
      </div>
    </div>
  )
}
